class Solution {
    public int stringCount(int n) {
        long mod = 1000000007;
        long[] fact = new long[n + 1];
        fact[0] = 1;
        for (int i = 1; i <= n; i++) {
            fact[i] = (fact[i - 1] * i) % mod;
        }

        if (n < 4) return 0;

        long total = fact[n];
        long unwanted = 1;
        for (int i = 1; i <= n - 4; i++) {
            unwanted = (unwanted + (fact[n - i] * 24) % mod * fact[i] % mod) % mod;
        }

        return (int)((total - unwanted + mod) % mod);
    }
}
